// --- Normalize dropdown option lists ---
// Some PDF widgets may have empty option arrays; inherit options from the first non-empty
// field in the same "group" (same name up to the last .<index>).
function _isBlankOptions(arr) {
  return !arr || !arr.length || arr.every(v => String(v || "").trim() === "");
}
function _choiceGroup(name) {
  const m = String(name || "").match(/^(.*)\.[0-9]+$/);
  return m ? m[1] : String(name || "");
}
const _choiceOptsByGroup = new Map();
for (const def of FIELD_DEFS) {
  if (def.kind !== "choice") continue;
  const g = _choiceGroup(def.name);
  if (!_choiceOptsByGroup.has(g) && !_isBlankOptions(def.options)) {
    _choiceOptsByGroup.set(g, def.options);
  }
}
for (const def of FIELD_DEFS) {
  if (def.kind !== "choice") continue;
  if (_isBlankOptions(def.options)) {
    const g = _choiceGroup(def.name);
    if (_choiceOptsByGroup.has(g)) def.options = _choiceOptsByGroup.get(g);
  }
}

// Date field helper (render as native date picker where supported)
function _isDateFieldName(name) {
  return name === "Date" || name === "Date3_af_date";
}

// --- Minor layout tweaks for web rendering ---
// Native date inputs reserve space for a calendar icon inside the field.
// Slightly widen the date fields so the full date stays visible.
for (const def of FIELD_DEFS) {
  if (def.kind === "text" && def.name === "Date") {
    def.rect.width = Math.min(22.5, 100 - def.rect.left - 0.5);
  }
  if (def.kind === "text" && def.name === "Date3_af_date") {
    // Move the bottom date field slightly left and widen it to the right
    // so the full date is visible next to the calendar icon.
    def.rect.left = Math.max(0.5, def.rect.left - 4.0);
    def.rect.width = Math.min(16.0, 100 - def.rect.left - 0.5);
  }

  // Increase signature pad height (Option B) for easier finger/stylus signing.
  if (def.kind === "text" && def.name === "Signature4") {
    const bottom = def.rect.top + def.rect.height;
    const newHeight = 3.8; // percent of page height
    def.rect.height = Math.min(newHeight, bottom - 0.5);
    def.rect.top = Math.max(0.5, bottom - def.rect.height);
  }
}



const elByName = new Map();   // for simple fields
const toggleByDD = new Map(); // ddName -> {selectEl, displayEl}
const toggleByTXT = new Map(); // txtName -> ddName

// Signature pads (Option B: draw signature)
const sigPads = new Map(); // name -> {canvas, ctx, dpr}

function _clearSigPad(pad) {
  if (!pad || !pad.ctx || !pad.canvas) return;
  const rect = pad.canvas.getBoundingClientRect();
  pad.ctx.clearRect(0, 0, rect.width, rect.height);
}

function clearAllSignatures() {
  for (const pad of sigPads.values()) _clearSigPad(pad);
}

function _resizeSignaturePad(name) {
  const pad = sigPads.get(name);
  if (!pad) return;

  const canvas = pad.canvas;
  const rect = canvas.getBoundingClientRect();
  if (!rect.width || !rect.height) return;

  // Preserve existing drawing (scaled)
  const prev = (canvas.width && canvas.height) ? canvas.toDataURL() : null;

  const dpr = window.devicePixelRatio || 1;
  canvas.width = Math.round(rect.width * dpr);
  canvas.height = Math.round(rect.height * dpr);

  const ctx = canvas.getContext('2d');
  pad.ctx = ctx;
  pad.dpr = dpr;

  // Draw in CSS pixel coordinates
  ctx.setTransform(dpr, 0, 0, dpr, 0, 0);
  ctx.lineCap = 'round';
  ctx.lineJoin = 'round';
  ctx.strokeStyle = '#000';
  ctx.lineWidth = 2;
  ctx.clearRect(0, 0, rect.width, rect.height);

  if (prev) {
    const img = new Image();
    img.onload = () => {
      ctx.drawImage(img, 0, 0, rect.width, rect.height);
    };
    img.src = prev;
  }
}

function resizeAllSignatures() {
  for (const name of sigPads.keys()) _resizeSignaturePad(name);
}

function createSignaturePad(def, page) {
  const wrap = makeFieldWrapper(def);

  const canvas = document.createElement('canvas');
  canvas.className = 'field signature-canvas';
  canvas.id = sanitizeId(def.name);
  canvas.dataset.sigName = def.name;
  canvas.setAttribute('aria-label', 'Signature');

  wrap.appendChild(canvas);
  page.appendChild(wrap);

  const pad = { canvas: canvas, ctx: canvas.getContext('2d'), dpr: 1, isDown: false };
  sigPads.set(def.name, pad);

  function pointFromEvent(e) {
    const r = canvas.getBoundingClientRect();
    return { x: (e.clientX - r.left), y: (e.clientY - r.top) };
  }

  function start(e) {
    e.preventDefault();
    if (!pad.ctx) _resizeSignaturePad(def.name);
    pad.isDown = true;
    const p = pointFromEvent(e);
    pad.ctx.beginPath();
    pad.ctx.moveTo(p.x, p.y);
  }

  function move(e) {
    if (!pad.isDown) return;
    e.preventDefault();
    const p = pointFromEvent(e);
    pad.ctx.lineTo(p.x, p.y);
    pad.ctx.stroke();
  }

  function end() {
    pad.isDown = false;
  }

  canvas.addEventListener('pointerdown', start);
  canvas.addEventListener('pointermove', move);
  canvas.addEventListener('pointerup', end);
  canvas.addEventListener('pointercancel', end);
  canvas.addEventListener('pointerleave', end);

  _resizeSignaturePad(def.name);
}

function sanitizeId(name) {
  return "f_" + name.replace(/[^a-zA-Z0-9_-]/g, "_");
}

function alignFromQ(q) {
  if (q === 1) return "center";
  if (q === 2) return "right";
  return "left";
}

function normOpt(s) {
  // PDF has blank options as spaces; normalize to empty string
  if (s == null) return "";
  const t = String(s).replace(/\r?\n/g, " ").trim();
  return t;
}

function buildOptionElements(options) {
  const opts = [];
  for (const raw of options || []) {
    const val = normOpt(raw);
    // Keep an empty option if the PDF had a blank option
    opts.push({ value: val, label: val });
  }
  // Ensure there is always a blank first option
  if (!opts.length || opts[0].value !== "") {
    opts.unshift({ value: "", label: "" });
  }
  return opts;
}

function setScaledFont(el, fontPt) {
  el.dataset.fontPt = String(fontPt || "");
}

function applyScale() {
  const page = document.getElementById("page");
  const bg = document.getElementById("bg");
  if (!page || !bg) return;

  const currentWidth = bg.clientWidth;
  const scale = currentWidth / DESIGN.bgWidthPx;

  // Scale font sizes (pt -> px at design -> scale)
  const all = page.querySelectorAll("[data-font-pt]");
  for (const el of all) {
    const ptStr = el.dataset.fontPt;
    if (!ptStr) continue;
    const pt = parseFloat(ptStr);
    if (!isFinite(pt)) continue;

    const pxAtDesign = pt * DESIGN.pxPerPtAtDesign; // since bg is 2x, pxPerPtAtDesign ~ 2
    el.style.fontSize = (pxAtDesign * scale).toFixed(2) + "px";
    el.style.lineHeight = "1";
  }

  // Keep signature pad canvases crisp and correctly sized
  if (typeof resizeAllSignatures === "function") resizeAllSignatures();
}

function makeFieldWrapper(def) {
  const w = document.createElement("div");
  w.className = "field-wrapper";
  w.style.left = def.rect.left + "%";
  w.style.top = def.rect.top + "%";
  w.style.width = def.rect.width + "%";
  w.style.height = def.rect.height + "%";
  return w;
}

function createToggleField(def, page) {
  const wrap = makeFieldWrapper(def);
  wrap.classList.add("toggle-wrap");

  const sel = document.createElement("select");
  sel.className = "field select toggle-dd";
  sel.id = sanitizeId(def.ddName);
  sel.name = def.ddName;
  sel.style.textAlign = alignFromQ(def.align);
  setScaledFont(sel, def.fontSelect || 12);

  const opts = buildOptionElements(def.options);
  for (const o of opts) {
    const optEl = document.createElement("option");
    optEl.value = o.value;
    optEl.textContent = o.label;
    sel.appendChild(optEl);
  }

  const disp = document.createElement("div");
  disp.className = "field toggle-txt";
  disp.tabIndex = 0;
  disp.setAttribute("role", "button");
  disp.dataset.name = def.txtName;
  disp.style.textAlign = alignFromQ(def.align);
  setScaledFont(disp, def.fontText || (def.fontSelect || 12) + 2);

  // initial state: show dropdown, hide display
  disp.style.display = "none";

  sel.addEventListener("change", () => {
    const v = sel.value;
    if (!v) {
      // blank -> keep dropdown visible
      disp.textContent = "";
      disp.style.display = "none";
      sel.style.display = "";
      return;
    }
    disp.textContent = v;
    sel.style.display = "none";
    disp.style.display = "flex";
  });

  function revertToSelect() {
    disp.style.display = "none";
    sel.style.display = "";
    sel.focus();
  }

  disp.addEventListener("click", revertToSelect);
  disp.addEventListener("keydown", (e) => {
    if (e.key === "Enter" || e.key === " ") {
      e.preventDefault();
      revertToSelect();
    }
  });

  wrap.appendChild(sel);
  wrap.appendChild(disp);
  page.appendChild(wrap);

  toggleByDD.set(def.ddName, { selectEl: sel, displayEl: disp });
  toggleByTXT.set(def.txtName, def.ddName);
}

function createChoiceField(def, page) {
  const wrap = makeFieldWrapper(def);

  const align = alignFromQ(def.align);
  const opts = buildOptionElements(def.options);

  if (def.editable) {
    // Editable combo box -> input + datalist
    const input = document.createElement("input");
    input.type = "text";
    input.className = "field input choice-input";
    input.id = sanitizeId(def.name);
    input.name = def.name;
    input.style.textAlign = align;
    setScaledFont(input, def.font || 12);

    const listId = input.id + "_list";
    input.setAttribute("list", listId);

    const dl = document.createElement("datalist");
    dl.id = listId;
    for (const o of opts) {
      if (!o.value) continue; // don't include empty in datalist
      const optEl = document.createElement("option");
      optEl.value = o.value;
      dl.appendChild(optEl);
    }

    wrap.appendChild(input);
    wrap.appendChild(dl);
    page.appendChild(wrap);
    elByName.set(def.name, input);
  } else {
    const sel = document.createElement("select");
    sel.className = "field select";
    sel.id = sanitizeId(def.name);
    sel.name = def.name;
    sel.style.textAlign = align;
    setScaledFont(sel, def.font || 12);

    for (const o of opts) {
      const optEl = document.createElement("option");
      optEl.value = o.value;
      optEl.textContent = o.label;
      sel.appendChild(optEl);
    }

    wrap.appendChild(sel);
    page.appendChild(wrap);
    elByName.set(def.name, sel);
  }
}

function createTextField(def, page) {
  const wrap = makeFieldWrapper(def);

  // Signature (Option B): drawn signature pad
  if (def.name === "Signature4") {
    createSignaturePad(def, page);
    return;
  }
  const align = alignFromQ(def.align);

  let el;
  if (def.multiline) {
    el = document.createElement("textarea");
    el.className = "field textarea";
  } else {
    el = document.createElement("input");
    el.type = _isDateFieldName(def.name) ? "date" : "text";
    el.className = "field input" + (_isDateFieldName(def.name) ? " date" : "");
  }
  el.id = sanitizeId(def.name);
  el.name = def.name;
  el.style.textAlign = align;
  if (def.readonly) el.readOnly = true;

  // Reduce font by 2pt for the large narrative fields requested
  let fontPt = def.font || 12;
  if (def.name === "LocationDescription of workRow1" ||
      def.name === "Additional NotesRow1" ||
      def.name === "Safety Huddle TopicRow1") {
    fontPt = Math.max(6, fontPt - 2);
  }

  // Date inputs are rendered as native pickers; keep text from colliding with the icon.
  // User request: top date 3pt smaller than current, bottom date 4pt smaller.
  if (def.name === "Date") {
    // def.font is 24pt; previously we used -2 (22pt). Now use -5 (19pt).
    fontPt = Math.max(6, fontPt - 5);
  }
  if (def.name === "Date3_af_date") {
    fontPt = Math.max(6, fontPt - 4);
  }
  setScaledFont(el, fontPt);

  wrap.appendChild(el);
  page.appendChild(wrap);
  elByName.set(def.name, el);
}

function createNoLunchToggle(def, page) {
  const wrap = makeFieldWrapper(def);

  const el = document.createElement("input");
  el.type = "text";
  el.className = "field input nolunch";
  el.id = sanitizeId(def.name);
  el.name = def.name;
  el.readOnly = true;
  el.style.textAlign = alignFromQ(def.align);
  setScaledFont(el, def.font || 12);

  el.addEventListener("click", () => {
    el.value = (el.value === "" || el.value === "0" || el.value === 0) ? (def.toggleValue || "0.5") : "";
  });

  wrap.appendChild(el);
  page.appendChild(wrap);
  elByName.set(def.name, el);
}

function createResetButton(def, page) {
  const wrap = makeFieldWrapper(def);

  const btn = document.createElement("button");
  btn.type = "button";
  btn.className = "reset-btn";
  btn.textContent = def.label || "RESET";
  btn.addEventListener("click", resetForm);

  wrap.appendChild(btn);
  page.appendChild(wrap);
}

function resetForm() {
  // Reset toggle fields (DD -> big text overlay)
  for (const [ddName, obj] of toggleByDD.entries()) {
    const sel = obj.selectEl;
    const disp = obj.displayEl;

    sel.value = "";
    sel.style.display = "";
    disp.textContent = "";
    disp.style.display = "none";
  }

  // Reset all other inputs/selects
  for (const [, el] of elByName.entries()) {
    el.value = "";
  }

  // Clear drawn signatures (Option B)
  if (typeof clearAllSignatures === "function") clearAllSignatures();

  // Restore default dates to today (matches initial page state)
  const todayIso = new Date().toISOString().slice(0, 10);
  for (const nm of ["Date", "Date3_af_date"]) {
    const el = elByName.get(nm);
    if (el) el.value = todayIso;
  }
}

function collectData() {
  const data = {};

  // toggles: store dropdown value (even if hidden)
  for (const [ddName, obj] of toggleByDD.entries()) {
    data[ddName] = obj.selectEl.value || "";
  }

  for (const [name, el] of elByName.entries()) {
    data[name] = el.value || "";
  }

  return data;
}

function applyData(data) {
  if (!data) return;

  // Apply toggles
  for (const [ddName, obj] of toggleByDD.entries()) {
    const sel = obj.selectEl;
    const disp = obj.displayEl;
    const v = (data[ddName] ?? "").toString();

    sel.value = v;

    if (v) {
      disp.textContent = v;
      sel.style.display = "none";
      disp.style.display = "flex";
    } else {
      disp.textContent = "";
      disp.style.display = "none";
      sel.style.display = "";
    }
  }

  for (const [name, el] of elByName.entries()) {
    if (!(name in data)) continue;
    el.value = (data[name] ?? "").toString();
  }
}

function downloadJson() {
  const data = collectData();
  const blob = new Blob([JSON.stringify(data, null, 2)], { type: "application/json" });
  const url = URL.createObjectURL(blob);
  const a = document.createElement("a");
  a.href = url;
  a.download = "dwl-entry.json";
  document.body.appendChild(a);
  a.click();
  a.remove();
  URL.revokeObjectURL(url);
}

function setupLoadJson() {
  const inp = document.getElementById("loadJson");
  inp.addEventListener("change", async () => {
    const f = inp.files && inp.files[0];
    if (!f) return;
    try {
      const text = await f.text();
      const data = JSON.parse(text);
      applyData(data);
    } catch (e) {
      alert("Could not load JSON: " + e);
    } finally {
      inp.value = "";
    }
  });
}

function init() {
  const page = document.getElementById("page");
  if (!page) return;

  // Build fields
  for (const def of FIELD_DEFS) {
    if (def.kind === "toggle") createToggleField(def, page);
    else if (def.kind === "choice") createChoiceField(def, page);
    else if (def.kind === "text") createTextField(def, page);
    else if (def.kind === "nolunch") createNoLunchToggle(def, page);
    else if (def.kind === "button" && def.name === "RESET_BUTTON") createResetButton(def, page);
  }

  // Default both date fields to today (only if empty)
  const todayIso = new Date().toISOString().slice(0, 10);
  for (const nm of ["Date", "Date3_af_date"]) {
    const el = elByName.get(nm);
    if (el && !el.value) el.value = todayIso;
  }

  // toolbar buttons
  document.getElementById("resetTop").addEventListener("click", resetForm);
  document.getElementById("printPdf").addEventListener("click", () => {
    applyScale();
    window.print();
  });

  // Ensure fonts are scaled correctly for printing
  window.addEventListener("beforeprint", applyScale);

  const bg = document.getElementById("bg");
  bg.addEventListener("load", applyScale);
  window.addEventListener("resize", applyScale);
  applyScale();
}

document.addEventListener("DOMContentLoaded", init);
